import React, { useEffect, useState } from "react";
import { apiRequest } from "../API/apiServices";

const CountryCodesPage = () => {
    const [countryCodes, setCountryCodes] = useState([]);

    const data__ = {
        user: "Admin",
        password: "GenAI@7070",
        token: "GenAI-CountryCodes",
    };

    useEffect(() => {
        fetchCountryCodes();
    }, []);

    const fetchCountryCodes = async () => {
        try {
            const response = await apiRequest(data__);
            console.log("API Response:", response);
            setCountryCodes(response); // Store API response in state
        } catch (error) {
            console.error("API Fetch Error:", error);
        }
    };

    return (
        <div className="p-4">
            <h1 className="text-2xl font-bold mb-4">Country Codes</h1>
            <ul className="list-disc pl-5">
                {countryCodes.length > 0 ? (
                    countryCodes.map((code, index) => (
                        <li key={index} className="text-lg">
                            {code.name} ({code.code})
                        </li>
                    ))
                ) : (
                    <p>Loading...</p>
                )}
            </ul>
        </div>
    );
};

export default CountryCodesPage;
